import React from 'react';
import { Link } from 'react-router-dom';

// styles

const UserLogin = () => {
    return (
        <div>
            <h1>Welcome</h1>
            <h2>Log in here</h2>
            <input type="text"></input>
            <input type="number" />

            <Link to="/landing">
                <button>Log in</button>
            </Link>
        </div>
    )
}

export default UserLogin
